Простое и удобное приложение для смартфонов «Компаньон» автоматически фиксирует проблемы со связью, а также позволяет абонентам Tele2 самостоятельно оценивать реальное качество связи в самых популярных сервисах по кнопке «Проверить сеть». Приложение передает информацию о возникающих проблемах и результаты тестов технической службе оператора.
В случае установки приложения на устройства с поддержкой двух и более SIM-карт необходимо убедиться, что SIM-карта Tele2 установлена в основном слоте (обычно слот №1).
Приложение корректно работает только для абонентов Tele2 Россия.
Установив приложение, Вы сможете:
— сообщать оператору о проблеме со связью непосредственно в месте её возникновения. При этом, сообщение будет автоматически включать информацию об уровне сигнала и  параметрах сети, необходимых технической службе;
— тестировать качество услуг связи в часто посещаемых Вами местах и там, где, по Вашему мнению, недостаточное покрытие или качество сервиса: измерять скорость передачи данных, качество видео-сервиса и веб-браузинга, уровень сигнала в помещениях и на улице;
— получать подробную информацию о сети Tele2 и статусе Вашего телефона;
— просматривать на карте покрытие сети Tele2 во всех местах, в которых Вы бываете или которые планируете посетить;
— быстро находить ближайшие салоны связи, где Вы сможете получить полноценное обслуживание, а также всегда иметь под рукой необходимый набор полезных номеров Tele2 для дистанционного обслуживания.
С помощью приложения «Компаньон» Вы сможете улучшать качество сети Tele2 в тех местах, где нужно именно Вам.

If you need to check your sound, take a look at this useful tool! Sound Check app is designed to generate sound with various frequency, from very low to very high. With this helpful utility you can easily check the sound quality of your headphones or just make some noise!

The main features of Sound Check app:
- a wide range of available wave frequency;
- 4 types of waves to choose from: sine, saw-tooth, triangle, and plane;
- a handy generator of different sounds and noises.

This app can be a checking tool for any headphones you're about to buy but want to test the quality of sound right off the bat, or a cool app for everyone who loves to tinker with sounds, sound waves, and sound effects!

